description:
Boinc-Ubuntu-9.10PL-AMD64 is polish remix of Ubuntu 9.10 Karmic Koala with BOINC client and manager applications pre-installed.
GIMP and gnome games are removed.
Compilation made by Krzysztof 'krzyszp' Piszczek from Polish BOINC Society: &lt;a href=&quot;
http://www.polskiprojektboinc.vel.pl&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
